import { Button, FormControl } from "@mui/material";
import VideoDefinition from "./VideoDefinition";
import VideoStandard from "./VideoStandard";
import React from "react";

function SearchCritera (props)
{
    const [videoDefinitions] = props.videoDefinitions;
    const [vdeoStandards] = props.videoStandards;
    return(
        <FormControl fullWidth>
            <VideoDefinition videoDefinitions = {videoDefinitions}></VideoDefinition>
            <VideoStandard videoStandards = {vdeoStandards}></VideoStandard>
        </FormControl>
    );
}

export default SearchCritera;
